sys_variable_value.value:
(function execute(inputs, outputs) {
  for(var property in inputs){
    if (inputs[property] == null || inputs[property].toString().trim() == "") {
      throw new Error(property + " cannot be empty");
    }
  }
  var util = new JSONBuilder();
  var payload ={};
  payload.location = inputs.location;
  var properties = {};
  var id = util.createObjectElement('id',inputs.sourceVirtualMachine);
  util.addObjectElement(properties,'sourceVirtualMachine',id);
  payload.properties = properties;
  outputs.payload = JSON.stringify(payload);
})(inputs, outputs)

